webpackJsonp([71758173816882],{1148:function(e,A){e.exports={data:{nodePost:{title:"A Flood Can Change Your Priorities",body:{value:'<p>This is what my kitchen looked like on November 7th. To even call it a kitchen is a stretch, although there was still a microwave set up off to the side.</p>\r\n\r\n<p>The last few months have been an interesting ride. In August I attended <a href="https://2018.decoupleddays.com/">Decoupled Drupal Days</a> and <a href="https://www.drupalgovcon.org/">Drupal GovCon</a> back to back and while both conferences were excellent, I found myself a little burnt out and itching to deliver something a little more concrete. Thankfully, that happened to align well with the opportunity to lead the development effort to rebuild my company\'s website. Coinciding with a substantial drop in output on this site, I dove headlong into converting hs2solutions.com to <a href="https://www.bounteous.com">bounteous.com</a> (new site, new brand, new everything!)</p>\r\n\r\n<p>October came along, and with it was my first trip to <a href="https://2018.badcamp.org/">BADCamp</a> at the end of the month. The timing wasn\'t great as we were launching the new brand on November 5th, but I was looking forward to the conference and the travel. While there was still quite a bit of work to do, I felt like we were on track for launch.</p>\r\n\r\n<p>So as I returned home from Berkley on October 28th I thought I had a pretty solid understanding of my priorities - a push to launch. The water line to my dishwasher disagreed, flooding my entire kitchen leading into the final week. As I saw the final touches on the website come together, I also had the joy of watching my kitchen come apart as the water damage was remediated. We made it though - <a href="https://www.bounteous.com">we have a website</a>, and while I don\'t have a kitchen, at least what remains is dry.</p>\r\n\r\n<p>This roller coaster of a fall has given me some interesting perspective as I start looking ahead to next year. I\'ll typically be making grand plans for the next 365 days, but this year I\'m a little more inclined to be flexible and allow myself to be led where my focus can have the most impact.  More enhancements lie ahead for the Bounteous site, and my personal site could use a fresh coat of paint along with an update to the latest version of <a href="https://www.gatsbyjs.org/">Gatsby</a>. Drupal community wise I\'m considering a little less travel and speaking and a little more contribution in code. The <a href="https://www.drupal.org/project/ui_patterns_pattern_lab">UI Patterns Pattern Lab</a> module seems to be getting some renewed interest as <a href="https://www.drupal.org/project/ui_patterns_pattern_lab">UI Patterns</a> recently had a stable release, so I\'m going to see if I can add some requested improvements and hopefully bring that module stable as well. Or maybe the proverbial kitchen will flood again, who knows.</p>\r\n\r\n<p>Whatever next year brings, I hope it is much drier and has a place to put my dishes.</p>'},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3333333333333333,src:"/static/8a07f78abd2a7d10e6e0fb3f3f816361-f1e9820823cf17c50a8c476f98c4ac43-42807.jpg",srcSet:"/static/8a07f78abd2a7d10e6e0fb3f3f816361-f1e9820823cf17c50a8c476f98c4ac43-960f9.jpg 313w,\n/static/8a07f78abd2a7d10e6e0fb3f3f816361-f1e9820823cf17c50a8c476f98c4ac43-c36f2.jpg 625w,\n/static/8a07f78abd2a7d10e6e0fb3f3f816361-f1e9820823cf17c50a8c476f98c4ac43-42807.jpg 1250w,\n/static/8a07f78abd2a7d10e6e0fb3f3f816361-f1e9820823cf17c50a8c476f98c4ac43-dbc5e.jpg 1875w,\n/static/8a07f78abd2a7d10e6e0fb3f3f816361-f1e9820823cf17c50a8c476f98c4ac43-6e234.jpg 2500w,\n/static/8a07f78abd2a7d10e6e0fb3f3f816361-f1e9820823cf17c50a8c476f98c4ac43-ca40d.jpg 3750w,\n/static/8a07f78abd2a7d10e6e0fb3f3f816361-f1e9820823cf17c50a8c476f98c4ac43-8532c.jpg 4032w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},created:1543075966}},pathContext:{slug:"/post/a-flood-can-change-your-priorities/"}}}});
